tables.table_schema:
CREATE TABLE cost_saving_opportunities (
    id INT PRIMARY KEY,
    product_name VARCHAR(255),
    cost DECIMAL(10, 2),
    savings DECIMAL(10, 2)
);

CREATE TABLE supply_chain_efficiency (
    id INT PRIMARY KEY,
    product_name VARCHAR(255),
    delivery_time INT,
    efficiency_rating DECIMAL(5, 2)
);

CREATE TABLE analytics_data (
    id INT PRIMARY KEY,
    analysis_date DATE,
    insights TEXT
);
